package Operators_In_JAVA;

public class NetsedForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int i=1;i<=3;i++)
		{
			System.out.println("i"+ " "+i);
			for(int j=1;j<=3;j++)
			{
				System.out.println("hello"+ " ");
			}
			System.out.println();
			
		}
	        
	     
	}
	

}
